import { createBrowserRouter } from "react-router-dom";
import Home from "../component/Home/Home";
import RestaurantDetails from "../component/restaurant/RestaurantDetails";
import Cart from "../component/cart/Cart";
import UserProfile from "../component/profile/UserProfile";
import Orders from "../component/profile/Orders";
import Favourites from "../component/profile/Favourites";
import Address from "../component/profile/Address";
import Events from "../component/profile/Events";

export const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
    children: [
      {
        path: "account/:register", // Removed the leading slash
        element: <Home />,
      },
      {
        path: "restaurant/:city/:title/:id", // Removed the leading slash
        element: <RestaurantDetails />
      },
      {
        path: "cart", // Removed the leading slash
        element: <Cart />
      },
      {
        path: "my-profile", // Removed the leading slash
        element: <UserProfile />,
        children: [

          {
            path: "orders", // Removed the leading slash
            element: <Orders />
          },
          {
            path: "favourites", // Removed the leading slash
            element: <Favourites />
          },
          {
            path: "address", // Removed the leading slash
            element: <Address />
          },
          {
            path: "notification", // Removed the leading slash
            element: <Events />
          }
        ]
      }
    ]
  }
]);
